import React from "react";
import { Box, Typography, Card, CardContent, CardMedia } from "@mui/material";
import { Link } from "react-router-dom";
import Image1 from "../assets/image1.png"; // Ensure this path matches your folder structure

const Portfolio: React.FC = () => {
    return (
        <Box
            sx={{
                backgroundColor: "#FFEEEE", // Light pink background
                minHeight: "100vh",
                padding: "4rem 2rem",
                display: "flex",
                flexDirection: "column",
                alignItems: "center",
                gap: "2rem",
                fontFamily: "'Kufam', sans-serif", // Apply Kufam font globally
            }}
        >
            {/* Section Title */}
            <Typography
                variant="h4"
                sx={{
                    color: "#4F0D81", // Dark purple for the title
                    fontWeight: "bold",
                    marginBottom: "1rem",
                    textAlign: "center",
                }}
            >
                MissPoppins App Redesign:
            </Typography>

            <Typography
                variant="subtitle1"
                sx={{
                    color: "#6C3483", // Light purple for subtitle
                    fontWeight: "medium",
                    marginBottom: "2rem",
                    textAlign: "center",
                }}
            >
                Simplifying Navigation and Boosting User Engagement
            </Typography>

            {/* Work Card */}
            <Card
                sx={{
                    display: "flex",
                    flexDirection: { xs: "column", md: "row" },
                    alignItems: "center",
                    justifyContent: "space-between",
                    backgroundColor: "#FFFFFF", // White card background
                    padding: "2rem",
                    borderRadius: "16px",
                    boxShadow: "0px 8px 16px rgba(0, 0, 0, 0.1)",
                    maxWidth: "900px",
                    width: "100%",
                    gap: "1.5rem",
                }}
            >
                {/* Text Section */}
                <CardContent
                    sx={{
                        flex: 1,
                        display: "flex",
                        flexDirection: "column",
                        gap: "1rem",
                    }}
                >
                    <Box
                        sx={{
                            backgroundColor: "#FDF3FD", // Light lavender box
                            padding: "1.5rem",
                            borderRadius: "12px",
                            display: "flex",
                            flexDirection: "column",
                            gap: "0.5rem",
                        }}
                    >
                        <Typography
                            variant="body1"
                            sx={{
                                color: "#000000", // Black text
                                marginBottom: "0.5rem",
                                fontSize: "1rem",
                            }}
                        >
                            <strong>Overview:</strong> Streamlined navigation and introduced strategic pricing to enhance the coach-client experience.
                        </Typography>
                        <Typography
                            variant="body1"
                            sx={{
                                color: "#000000",
                                marginBottom: "0.5rem",
                                fontSize: "1rem",
                            }}
                        >
                            <strong>Role:</strong> UX Researcher, UX/UI Designer
                        </Typography>
                        <Typography
                            variant="body1"
                            sx={{
                                color: "#000000",
                                fontSize: "1rem",
                            }}
                        >
                            <strong>Toolkit:</strong> Figma, FigJam, Pencil and paper
                        </Typography>
                    </Box>
                </CardContent>

                {/* Image Section */}
                <CardMedia
                    component="img"
                    image={Image1}
                    alt="MissPoppins App Mockup"
                    sx={{
                        maxWidth: "250px", // Adjust image size
                        borderRadius: "12px", // Rounded corners
                    }}
                />
            </Card>
        </Box>
    );
};

export default Portfolio;
